import { ContextGlobalProvider } from "../ContextGlobal";
function DefaultPage(props) {
  return (
    <ContextGlobalProvider pageType={props.pageType}>
      <LayoutDefault>
        <Error statusCode={props.statusCode} />
      </LayoutDefault>
    </ContextGlobalProvider>
  );
}
